import React from "react";
import "./Card.scss";

const Card = props => {
  return (
    <section className="todo">
      <section
        className="card"
        style={{ backgroundImage: `url(${props.img})` }}
      >
        <h1 style={{ color: props.color }}>{props.title}</h1>
        <div className="contenedor-Texto">
        <p>{props.texto}</p>
        <input type="checkbox"/>{props.texto}
        </div>
      </section>
    </section>
  );
};

export default Card;
